import React from 'react'
import "./Login.css"
function Login() {
    return (
        <div className='login'>
          <img src="https://www.google.com/url?sa=i&url=http%3A%2F%2Fwww.mahesh-europe.com%2Fcontact-details%2Flinkedin-logo-2011-2019%2F&psig=AOvVaw08fpLtqUMXqUWyO0wYHlrM&ust=1640006881320000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMCZ8e777_QCFQAAAAAdAAAAABAJ"/>
        </div>
    )
}
export default Login
